svg.script:
var svgNS = "http://www.w3.org/2000/svg";







function init(evt)
{
        if ( window.svgDocument == null )
        {
                svgDocument = evt.target.ownerDocument;
        }

                  addRotateTransform('gear1', 9, 1, "freeze");
                  addRotateTransform('gear1', 8, 1.5);
                  addRotateTransform('gear1', 7, 2);


                 addRotateTransform('gear2', 9, -0.2,"freeze");
                 addRotateTransform('gear2', 8, -0.6);
                 addRotateTransform('gear2', 6.5, -1);

                 addRotateTransform('gear3', 9, -0.2,"freeze");
                 addRotateTransform('gear3', 8, -0.8);
                 addRotateTransform('gear3', 6, -1);

                 addRotateTransform('gear4', 9, 1.5,"freeze");
                 addRotateTransform('gear4', 7, 2);
                 addRotateTransform('gear4', 6, 3);

                 addRotateTransform('gear5', 9, -0.2,"freeze");
                 addRotateTransform('gear5', 7, -0.8);
                 addRotateTransform('gear5', 6, -1);

                  addRotateTransform('gear7', 9, 0.2,"freeze");
                  addRotateTransform('gear7', 7, 0.7);
                  addRotateTransform('gear7', 6, 1);

                  addRotateTransform('gear8', 9, 0.3,"freeze");
                  addRotateTransform('gear8', 8, 0.7);
                  addRotateTransform('gear8', 7, 1);


                 addRotateTransform('gear9', 6, 0.2,"freeze");
                 addRotateTransform('gear9', 5, 0.8);
                 addRotateTransform('gear9', 3, 1);

                 addRotateTransform('gear10', 9, 0.7,"freeze");
                 addRotateTransform('gear10', 7, 1.2);
                 addRotateTransform('gear10', 6, 1.7);


                 addRotateTransform('gear11', 9, 0.5,"freeze");
                 addRotateTransform('gear11', 8, 0.7);
                 addRotateTransform('gear11', 6.5, 1);

                 addRotateTransform('gear12', 9, 0.2,"freeze");
                 addRotateTransform('gear12', 7, 0.7);
                 addRotateTransform('gear12', 5, 1);


                 addRotateTransform('gear13', 8, 0.5,"freeze");
                 addRotateTransform('gear13', 6, 1.2);
                 addRotateTransform('gear13', 4, 1.6);







}

function addRotateTransform(target_id, speed, direction,item)
{
var element_to_rotate = svgDocument.getElementById(target_id);
var my_transform = svgDocument.createElementNS(svgNS, "animateTransform");

var bb = element_to_rotate.getBBox();
var cx = bb.x + bb.width/2;
var cy = bb.y + bb.height/2;



my_transform.setAttributeNS(null, "attributeName", "transform");
my_transform.setAttributeNS(null, "attributeType", "XML");
my_transform.setAttributeNS(null, "type", "rotate");
my_transform.setAttributeNS(null, "dur", speed + "s");
my_transform.setAttributeNS(null, "repeatCount", "0.6");
my_transform.setAttributeNS(null, "from", "0 "+cx+" "+cy);
my_transform.setAttributeNS(null, "to", 360*direction+" "+cx+" "+cy);
        my_transform.setAttributeNS(null, "fill", item);



element_to_rotate.appendChild(my_transform);
my_transform.beginElement();
}
